INSERT INTO `outcome` VALUES ('386.000000000000000','1-121313174','05','ROC-00304705','2011/07/05','Routine schedule/planned','People told us how they were given advice over their menu planning, budgeting and food shopping. Some people also explained how they were supported to develop cooking skills. One person said,\" the staff help us to eat healthily but we can choose what we want to eat‚Äù. Another person described how they have been helped to understand their diet better by making list of meals they can prepare. One person we spoke to said they managed all their own cooking and only had help from staff in terms of managing their food budget. All the people we spoke to said they were satisfied with the support and advice they received in respect of diet and planning their menus.','Staff receive basic food handling training and infection control training. Staff we spoke to said the level of support depended on the individual skills of the person being supported. Staff told us that a need for support around diet and nutrition and menus planning would be identified in the support plan.',NULL,NULL,'People told us that the staff arrived on time and that they always knew which staff to expect. All the people we spoke to were supported by a single staff member at a time and all said they thought they received sufficient input. People told us that the staff had the skills and knowledge to meet their needs and that only staff known to them provided their support.\r\n\r\nStaff said that people received the staffing hours and input that the funding provided for. Staff told us that there were on call arrangements in place if staff were delayed for any reason, and that cover was also arranged through their manager if people were off sick. Staff told us they thought the systems were effective and that support was always provided when it was scheduled.','ML-ROC-3953',NULL);
INSERT INTO `outcome` VALUES ('386.000000000000000','1-121313174','06','ROC-00304706','2011/07/05','Routine schedule/planned','One person described how they had first started receiving a service from the provider and how this had been a positive experience for them. Whilst in their previous placement they had met staff with whom they completed an assessment of their needs and aspirations. They said they had been visited several times and had been fully involved in planning the support plan they would eventually receive. Staff said they visited the placement and met staff and other professionals and this had helped promote continuity.\r\n\r\nPeople said they were supported to attend appointments with health and social care professionals.','We spoke to health and social care professionals who have had involvement with the provider and all said the organisation and staff had communicated and liaised professionally and responded to questions or requests promptly. People said that the people receiving a service were always involved in any decision making and that the assessment and reviewing process for support plans was thorough.\r\nSome of the people receiving a service may access other professionals independently of the provider',NULL,NULL,'People told us that the staff arrived on time and that they always knew which staff to expect. All the people we spoke to were supported by a single staff member at a time and all said they thought they received sufficient input. People told us that the staff had the skills and knowledge to meet their needs and that only staff known to them provided their support.\r\n\r\nStaff said that people received the staffing hours and input that the funding provided for. Staff told us that there were on call arrangements in place if staff were delayed for any reason, and that cover was also arranged through their manager if people were off sick. Staff told us they thought the systems were effective and that support was always provided when it was scheduled.','ML-ROC-3953',NULL);
