INSERT INTO `outcome` VALUES ('760.000000000000000','RW605','02','ROC-00082102','2011/03/03','Routine schedule/planned','','The trust rated itself as compliant for this outcome.\r\nThe trust supplied an audit of standard of consent. 98% of healthcare records contained a consent form and of these all had the proposed treatment or procedure documented. The trust has also told us that procedures regarding consent were being further developed and procedure specific consent will be introduced',NULL,NULL,'Comments on the Patients Choices website were on the whole positive. We heard that patients were seen on time and received excellent care. Comments were made about procedures and findings being clearly explained and the staff being friendly and helpful. We did hear of a negative experience where the doctor did not treat the patient with respect.','ML-ROC-0779',NULL);
INSERT INTO `outcome` VALUES ('760.000000000000000','RW605','09','1-57KFAW','2011/10/31','Review improvements','Quisque semper, lacus non convallis scelerisque, orci libero semper ','Ut vitae urna vitae leo posuere molestie. Fusce eu leo a pede vestibulum sagittis. Donec dapibus lacus a orci. Nam vitae leo quis erat luctus consequat. Donec eu est. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Aenean nec est. Nullam sed justo. Mauris elit ante, pretium bibendum, hendrerit et, consequat vel, nisl. Duis consectetuer sapien vitae metus. Vestibulum risus. Integer porttitor placerat mauris. Morbi sapien augue, mattis eu, ultrices quis, adipiscing vel, metus. Donec at metus nec leo porttitor placerat. Cras ac tellus. Sed sed mauris. In at quam pulvinar lectus imperdiet bibendum. Etiam mollis egestas erat. Nam porttitor arcu nec pede. Nullam gravida blandit dui. Ali',NULL,NULL,'Cras ut lectus. Vestibulum ante ipsum primis in faucibus orci l','1-52VEXZ',NULL);
INSERT INTO `outcome` VALUES ('760.000000000000000','RW605','14','ROC-00082114','2011/03/03','Routine schedule/planned','','The trust rated itself as compliant for this outcome.\r\nThe staff that we spoke to within the trust as a whole told us about the mandatory training they received. We also heard that there is good access to training, including degree courses.\r\nThe trust told us that their target is for 90% of staff to have had an appraisal during year end 31 March 2011. For 2009-10 the figure was 80%. We spoke to staff within the trust and most told us that they had had an appraisal within the last year. They also told us that they had a personal development plan.',NULL,NULL,'Comments on the Patients Choices website were on the whole positive. We heard that patients were seen on time and received excellent care. Comments were made about procedures and findings being clearly explained and the staff being friendly and helpful. We did hear of a negative experience where the doctor did not treat the patient with respect.','ML-ROC-0779',NULL);
