INSERT INTO `outcome` VALUES ('1565.000000000000000','1-121751465','24','ROC-00134724','2011/04/15','Routine schedule/planned','No comments were made by people living in the home about the role of a registered manager.','The provider told us that the new manager had completed their probationary period. This meant the manager would be applying to register with the Care Quality Commission. At the time of writing this report we have not received a registered manager\'s application form.\r\nThe new manager is actively involved in developing action plans to address the shortfalls‚Äô he has identified in the home. Staff felt they received appropriate leadership and said they could talk to both the new manager and the provider at any time.',NULL,NULL,'People we spoke to were very complimentary about the staff and the care they received at The Knoll Care Home.\r\nPeople living in the home told us:\r\n‚ÄúI am happy living here they are all so nice.‚Äù\r\n‚ÄúIt isn‚Äôt my home but I know I need to live here now, and it is a good place to live. The staff are always kind.‚Äù\r\n‚ÄúI usually like to sit in this part of the lounge, but if I want to stay in my room they look after me just as well.‚Äù\r\nPeople also commented on the food provided in the home, ‚Äúthe food is always good here; always a choice if there is something I don‚Äôt like.‚Äù\r\n\r\n ‚ÄúI really like the food; the cook is brilliant and comes out to talk to us to find out what we like.‚Äù\r\n\r\nThe people we met said they felt they could talk to all the staff and the manager whenever they wanted to. We saw the manager and staff talking to people in a relaxed and friendly manner.\r\n\r\nOne relative told us‚Äù I am very happy with the way my mother is looked after. I come here quite often and I like the way relatives are welcomed. We have a meeting this afternoon for relatives and they do listen and take on board what you say.‚Äù\r\n\r\nAnother relative said ‚ÄúI am really happy with the food people are offered here, and we can join them at mealtimes if we let them know soon enough. They are always offering people a drink and the cakes are homemade, makes a difference.‚Äù','ML-ROC-1821',NULL);
