INSERT INTO `outcome` VALUES ('611.000000000000000','RJF02','01','ROC-00005201','2011/06/20','Routine schedule/planned','During our visit to Burton Hospitals NHS Foundation Trust, Queens Hospital, we saw that in the majority of instances the staff involved patients and their relatives, (where appropriate) in decision making about their care. Some patients we spoke with commented they felt involved and could discuss their care because the staff were, ‚Äúvery friendly, kind and caring.\" We overheard care staff and nursing staff giving helpful descriptions and explanations to patients about the support they were offering. On all occasions we noted curtains were drawn to ensure that privacy and dignity was maintained.\r\n\r\nAll but one of the patients we spoke with were satisfied that the treatment options available to them, and they said these had been adequately explained. Some people we spoke with had communication difficulties and could not remember clearly what they had been told. It was evident on speaking with the staff that everyone was knowledgeable about the patients on the ward and understood their individual needs. The staff could clearly identify people and were able to provide informative answers when we asked for specific information about patients. The staff confirmed they had a handover on every shift and felt this was valuable. This was where important information was passed on from one shift to another and shared with the staff to ensure continuity of care.\r\n\r\nWe consider some improvements could be made regarding consent to care and treatment. This is because we observed and were told the following:\r\n\r\n‚ÄúNormally they discuss things with me but when they take blood they just say; ‚ÄòI have come to take your blood‚Äô, I am not given a choice about having it done.‚Äù\r\n\r\nWe spoke with an occupational therapist who told us:\r\n‚ÄúAn introduction to each patient is offered daily prior to gain consent for interventions. It is essential to ascertain the patient wants to engage at that time, otherwise we will come back later.‚Äù\r\n\r\nWe observed patients spending time with the occupational therapist, but they did not receive any further input during our visit by any of the ward staff. One person was waiting for a walk with their walking frame. They were promised this three times during the morning and were still waiting at lunchtime. The patient told us, ‚Äúthis was a problem on the ward‚Äù and, ‚Äúwe do not get the opportunity to walk often enough.‚Äù One person said, ‚ÄúI could do with this three or four times a day and I get it once if I am lucky.‚Äù\r\n\r\nThe ward staff told us most complaints from relatives and patients were about the lack of therapy services. They said; ‚Äúpeople can‚Äôt believe we operate a five day service when patients require interventions seven days a week. If a patient is admitted on a Friday, they won‚Äôt get seen till Monday.‚Äù\r\n\r\nThe staff were observed treating patients with respect at all times. Patient‚Äôs privacy and dignity was maintained. Toilets and bathrooms were within easy reach. All patients were accommodated in single sex bays or wards when we visited. . Patients we spoke with felt the staff were respectful and told us that staff called them by there preferred name, which was written over their bed, as was other significant information.\r\n\r\nPeople told us:\r\n\"They always draw the curtains they explain things well if I don‚Äôt understand.\"\r\nThere were good interactions noted, the staff were professional, kind and caring towards patients. All patients on the wards were sitting out of bed, in their own clothes or pyjamas. It was evident they had good personal care delivered because everyone looked well cared for, and the bed space was clean and tidy.\r\nWe spoke with patients about their call bells, (all were seen to be close at hand) and if they considered they were treated with dignity, here are some of their comments:\r\n‚ÄúI do ring the bell at night and it is not long until they come.‚Äù\r\n‚ÄúThey cover me with a towel and help where help is needed.‚Äù\r\n\r\nOne of the staff told us they were continually trying to improve practice. An example they gave was that they now always close the curtains when patients were using equipment such as a frame or rotunda. This was introduced in case the patients felt people were watching them, which could make the person feel under pressure or uncomfortable.','Information we hold about the provider tells us there are no concerns raised in relation to dignity, by the outcome risk estimates. The patient environment action team (PEAT) scores identified in the national patient safety agency (NPSA) from the latest survey, January-March 2010 records ‚Äòexcellent‚Äô in this outcome.\r\nBesides obtaining views of people during our visit we also looked at NHS Choices which is a website where people can post comments about the service they have experienced. This was last updated on June 18 2010. It told us 68% of people (11 out of 16) would recommend the hospital to a friend, people had posted comments which included: ‚ÄúThe patience, professionalism and kindness I was shown was great. I was kept well informed of what was happening and what was going to happen. To sum all the staff up that day in one word I would use ‚Äòexcellent‚Äô.\"\r\n\r\nWe spoke with senior ward staff who discussed the national dignity agenda, the staff were very aware of its content and it was evident they promote this within their areas. Matron, sister and the nursing assistant attended the national dignity conference recently. The trust had adopted a positive approach to the involvement of people and their families in the delivery and shaping of care.\r\n\r\nBoth matron and the head nurse were new in post. They told us actions from complaints were discussed at monthly meeting whereby all staff were encouraged to attend to ensure learning takes place. ‚ÄòAfternoon tea‚Äô with matron was offered to encourage interaction and communication with staff, patients and relatives. Patient Advice and Liaison Services (PALS) attended this too. It was evident patient information and feedback was considered as ‚Äúrich information‚Äù and clearly used to review and improve care and services.',NULL,NULL,'Most people who used the service (patients) told us all the staff involved them in their care, treatment and support. They confirmed their privacy and dignity was respected. Most people told us that staff responded to their needs quickly and verified the staff were kind and explained what was happening to them.\r\n\r\nComments included:\r\n‚ÄúI am more than happy with the staff; their treatment is superior.‚Äù\r\n‚ÄúI am treated well. They do come and check on me regularly.‚Äù\r\n‚ÄúNormally they discuss things with me but when they take blood they just say; ‚ÄòI have come to take your blood‚Äô, I am not given a choice about having it done.‚Äù\r\n\r\nWe talked to people about meals and mealtimes and observed the lunch being served on two wards. People said they were offered a good choice at mealtimes. All but one person we spoke with were happy with the food, choice, portion size and how their food was presented.\r\n\r\nComments included:\r\n‚ÄúThe food is really nice, loads of choice and not repetitious.‚Äù\r\n‚ÄúThey have talked to me about diet and food, I am quite happy with the menu.‚Äù\r\n‚ÄúI only eat breakfast here my family bring my other meals in. The food is awful I can‚Äôt eat it. I get plenty of drinks though, including hot drinks.‚Äù','ML-DAN-0053',NULL);
