INSERT INTO `outcome` VALUES ('1987.000000000000000','1-110059740','06','ROC-00286206','2011/06/22','Routine schedule/planned','People who use the service that were spoken with told us that they have access to a doctor should they require one and to the hairdresser who comes in every Thursday and they are very nice.','In the transition application the provider declared compliance with this regulation, and confirmed access to external health professionals such as audiology, wheelchair services, SALT, McMillian Nurses, pain management through general practitioners, brain injury, shunt specialists, psychiatric team, stoma care, physiotherapists, occupational therapists and continence specialists, when required, which ensures an individual holistic care approach.\r\nThe statement of purpose confirms that the home will liaise with other local health professionals as required such as doctors, occupational therapists, SALT, dentists, and opticians to provide those entrusted to our care with the specialist services they require.',NULL,NULL,'People who use the service that were spoken with told us that they generally feel safe in the home and that staff are kind and helpful.\r\nThey told us that there are some activities planned but they are not individualised and at times do not happen. They stated that they do not go out on trips, but they have television but no access to Sky DVD\'s or videos.\r\nThey confirmed that the food is very nice. They stated that the staff do not go through their individual care programmes with them.','ML-ROC-3648',NULL);
INSERT INTO `outcome` VALUES ('1987.000000000000000','1-110059740','11','ROC-00286211','2011/06/22','Routine schedule/planned','People who use the service that were spoken with told us that there is no transport to take them out, that there is television but they have no access to Sky, DVD or videos.','In the transition application the provider declared compliance with this regulation. The transition registration application informed us that regular maintenance and prompt attention of faults to the environment and equipment ensure the service is fit to provide residents with their basic human rights.\r\nThe manager confirmed that a planned preventative maintenance programme is in place, and appropriate service level agreements or contracts are also in place and are current. Confirmation was given that the gas service was performed in April 2011, water inspection would be performed in May, and that the portable appliance testing\'s are performed on an ongoing basis.\r\nOne of the sitting room clocks displayed the incorrect time as did one of the wrist watch belonging to one of the people living in the home.',NULL,NULL,'People who use the service that were spoken with told us that they generally feel safe in the home and that staff are kind and helpful.\r\nThey told us that there are some activities planned but they are not individualised and at times do not happen. They stated that they do not go out on trips, but they have television but no access to Sky DVD\'s or videos.\r\nThey confirmed that the food is very nice. They stated that the staff do not go through their individual care programmes with them.','ML-ROC-3648',NULL);
