INSERT INTO `outcome` VALUES ('3043.000000000000000','1-111178080','06','ROC-00309906','2011/06/26','Routine schedule/planned','The home ensures that people have access to appropriate health care professionals. People living at the home confirmed that the home ‚Äúwill always get the doctor when needed‚Äù.\r\nDuring our visit the person in charge requested a GP visit for one individual who was feeling poorly.\r\n\r\nThe person in charge told us that they have ‚Äúvery good‚Äù support and input from doctors and specialised health care professionals.','We were informed that people using the service are assessed by the home‚Äôs manager before a placement is offered. We looked at three care plans for people who had recently moved to the home but were unable to see any documented evidence of a pre-admission assessment. The person in charge stated that these may be in another office which, in the absence of the manager, we were unable to access.\r\n\r\nWe were able to see that the home were following the recommendations made by health care professionals. Some examples of this included advice from a diabetic nurse and the speech and language team. Care plans had been updated and records confirmed that the recommendations were being followed.\r\n\r\nCare plans examined contained the contact details of relatives and health care professionals and who should be contacted in the event of an emergency.',NULL,NULL,'During our visit we spoke with a number of people using the service. They told us that they were able to make decisions about their lives and that they were treated with respect by staff working at the home. They said; ‚ÄúI can choose exactly what I want to do‚Äù, ‚ÄúThe staff never tell you what to do, they ask you what you would like to do‚Äù.\r\nPeople living at the home also told us; ‚ÄúThe staff are very respectful and very kind‚Äù.\r\nTwo people told us that they had made an informed decision to move to the home. They told us that they had been provided with information about the home and had been able to visit the home before making a decision to move there. One person told us that they had used the home‚Äôs ‚Äòrespite‚Äô facility before decided to move to the home on a permanent basis.\r\n\r\nThe staff we spoke with were aware that each individual must be supported to make their own decisions and that they should be supported to make choices about their lives. We looked at a number of care plans and these contained information about people‚Äôs assessed needs and preferences although none had been signed or agreed by the individual and there was no information regarding people‚Äôs preferences for end of life care and following death.\r\n\r\nWe found the atmosphere in the home to be ‚Äòrelaxed‚Äô and ‚Äòinclusive‚Äô. People appeared relaxed in the presence of staff and communication was noted to be kind and respectful.\r\nPeople living at the home told us ‚Äúall the staff here are so kind‚Äù, ‚ÄúThey will do anything for you, they are so very kind‚Äù.\r\nThey also told us; ‚ÄúThey are so respectful when helping me to have a bath‚Äù, ‚ÄúI like to get up early and the girls always bring me a cup of tea when I wake up‚Äù.\r\nWe were able to see that each person had access to a call bell. Those people not in their bedrooms were seen to be wearing a ‚Äòpendant‚Äô call bell. People spoken with confirmed that staff responded to call bells promptly during the day and at night.\r\nStaff interactions with people using the service were noted to be kind and respectful. It was apparent that staff knew each individual well and that they were aware of peoples‚Äô assessed needs and preferences.\r\n\r\nThe home ensures that people have access to appropriate health care professionals. People living at the home confirmed that the home ‚Äúwill always get the doctor when needed‚Äù.\r\nDuring our visit the person in charge requested a GP visit for one individual who was feeling poorly.\r\nThe person in charge told us that they have ‚Äúvery good‚Äù support and input from doctors and specialised health care professionals.\r\n\r\nDuring our visit we observed the senior carer on duty administering the morning and lunch time medicines in a safe and appropriate manner. The staff member took time to explain the medicines to each individual and remained with each person until they had taken their medicines.\r\nMedicines were dispensed to each individual from a trolley which was locked when left unattended. We observed the staff member making an appropriate entry in the medication administration record only after the medicine had been taken by the individual.\r\nWe were informed that only senior care staff who have been appropriately trained are involved in the management and administration of peoples‚Äô medication. A list of these staff along with their signature and initials was made available.\r\n\r\nEach person spoken with during our visit was very complimentary about the provision of food at the home. They told us; ‚Äúthere is plenty to eat and you can always have snacks if you want them‚Äù, ‚Äúthe food is very good and you never go hungry here‚Äù. ‚ÄúThe staff know what I like and what I don‚Äôt like‚Äù.\r\nPeople told us that they were asked about their meal preferences the day before. People confirmed they were offered choices although on the day of our visit, each person was provided with the same meal.\r\n\r\nOn the morning of our visit we asked people if they knew what was for lunch and nobody did. Menus were not displayed for people.\r\nWe observed staff offering assistance to an individual in an appropriate and unhurried manner.\r\nPeople were offered a choice of hot drinks throughout the day and cold drinks were seen to be available in communal areas and individual bedrooms.\r\n\r\nPeople living at the home appeared relaxed and comfortable in the presence of staff and nobody spoken with raised any concerns regarding the way they were treated or of the care they received. People said, ‚Äúthe staff are very kind here‚Äù, ‚ÄúThey are all so kind and caring‚Äù, ‚ÄúI feel very safe well cared for here‚Äù.\r\nDuring our visit we were able to speak with a number of staff working at the home and they were able to demonstrate a good understanding of what constituted abuse. Staff told us that they ‚Äúwould not hesitate‚Äù in reporting abuse where suspected or witnessed however, staff were not aware of how or who to report concerns to outside of the home. Staff were not aware of Somerset‚Äôs policy on safeguarding adults and the policy could not be located during our visit.\r\nWe did not have access to a staff training matrix but all care staff spoken with during our visit confirmed that they had not received any formal training on safeguarding adults from abuse.\r\n\r\nDuring our visit we viewed all communal areas and a selection of bedrooms and we found the standard of cleanliness to be very good with no malodours.\r\nWe were able to see that staff had access to a good supply of protective equipment such as gloves and aprons and that these were being used appropriately as ‚Äòsingle use‚Äô.\r\nPeople told us that they felt ‚Äúwell looked after‚Äù. Staff confirmed that they did not experience any concerns in meeting the needs of people living at the home.\r\nPeople commented on the kindness of the staff. They also told us that, although staff were ‚Äúvery busy‚Äù, they did not feel rushed when receiving assistance from staff.\r\nMost of the people we spoke with told us that since the activity coordinator left in April of this year, there was not much going on in the home. They said; ‚Äúthe activities used to be really good but now all we do is sit around‚Äù. They also said; ‚Äúthere isn‚Äôt anything going on, I just watch television‚Äù, ‚ÄúIt would be really nice if we could have the activities back, there used to be so much and we used to have entertainers come in‚Äù. The home is currently in the process of recruiting a new activity coordinator.\r\n\r\nThe Towans has been suitably adapted and extended to meet the needs of older people. Bedrooms are for single occupancy and we were able to see that people are able to personalise their rooms. We found bedrooms to be very comfortable furnished and some people had chosen to bring items of their own furniture with them.\r\nPeople told us; ‚ÄúI am very happy here and I love my room‚Äù, ‚ÄúI like to sit in my room as I have all my things around me and I have a lovely sea view‚Äù, ‚ÄúIt was very hard leaving my home but I could bring some of my furniture with me and it makes it feel more like home‚Äù.\r\n\r\nMobile and fixed hoists are available to assist people with their mobility needs and people have access to appropriate numbers of assisted bathing and toilet facilities. We were able to see evidence that all equipment had been regularly serviced by outside contractors.\r\nA call bell system is installed throughout the home so that people can call staff for assistance as required. People told us that staff responded promptly to call bells. ‚ÄúI sometimes have to use my call bell at night and the staff come quite quickly‚Äù, ‚ÄúI don‚Äôt need to use my bell much but the staff always come when I need them‚Äù. During our visit we saw that people had easy access to their call bells.\r\n\r\nStaff spoken with during our visit confirmed that they completed a period of induction when they first started working at the home which ensured they have the skills and training needed to enable them to meet the needs of people living at the home. Staff also told us they had at least two ‚Äòshadow shifts‚Äô with more experienced staff, before they worked as part of the shift.\r\nStaff working at the home told us that they received regular one to one supervisions with the manager. They confirmed that this provided them with opportunities to discuss training needs.\r\n\r\nDuring our visit we asked people if they would feel confident in raising concerns if they had any. People told us, ‚ÄúYes, I would always tell someone if I had any concerns or worries‚Äù, ‚ÄúI don‚Äôt have any worries at all‚Äù.\r\nStaff spoken with during our visit knew what to do if a person using the service or a visitor raised concerns about the care they received or the service provision.\r\n\r\nWe examined a range of records during our visit and all were found to be well maintained and up to date. We saw that all records pertaining to people using the service had been securely stored to ensure confidentiality.\r\nAll staff working at the home are required to sign a code of conduct and confidentiality policy.','ML-ROC-4033',NULL);
INSERT INTO `outcome` VALUES ('3043.000000000000000','1-111178080','21','ROC-00309921','2011/06/26','Routine schedule/planned','We examined a range of records during our visit and all were found to be well maintained and up to date. We saw that all records pertaining to people using the service had been securely stored to ensure confidentiality.\r\n\r\nAll staff working at the home are required to sign a code of conduct and confidentiality policy.','At the time of the visit we requested to see various records relating to people living at the home, staff working at the home and records relating to the running of the home. All information was made available and all records seen were well maintained and up to date.\r\n\r\nWe found individual care plans to be up to date and these contained clear information about peoples‚Äô assessed needs and preferences. Emergency contacts had also been recorded.',NULL,NULL,'During our visit we spoke with a number of people using the service. They told us that they were able to make decisions about their lives and that they were treated with respect by staff working at the home. They said; ‚ÄúI can choose exactly what I want to do‚Äù, ‚ÄúThe staff never tell you what to do, they ask you what you would like to do‚Äù.\r\nPeople living at the home also told us; ‚ÄúThe staff are very respectful and very kind‚Äù.\r\nTwo people told us that they had made an informed decision to move to the home. They told us that they had been provided with information about the home and had been able to visit the home before making a decision to move there. One person told us that they had used the home‚Äôs ‚Äòrespite‚Äô facility before decided to move to the home on a permanent basis.\r\n\r\nThe staff we spoke with were aware that each individual must be supported to make their own decisions and that they should be supported to make choices about their lives. We looked at a number of care plans and these contained information about people‚Äôs assessed needs and preferences although none had been signed or agreed by the individual and there was no information regarding people‚Äôs preferences for end of life care and following death.\r\n\r\nWe found the atmosphere in the home to be ‚Äòrelaxed‚Äô and ‚Äòinclusive‚Äô. People appeared relaxed in the presence of staff and communication was noted to be kind and respectful.\r\nPeople living at the home told us ‚Äúall the staff here are so kind‚Äù, ‚ÄúThey will do anything for you, they are so very kind‚Äù.\r\nThey also told us; ‚ÄúThey are so respectful when helping me to have a bath‚Äù, ‚ÄúI like to get up early and the girls always bring me a cup of tea when I wake up‚Äù.\r\nWe were able to see that each person had access to a call bell. Those people not in their bedrooms were seen to be wearing a ‚Äòpendant‚Äô call bell. People spoken with confirmed that staff responded to call bells promptly during the day and at night.\r\nStaff interactions with people using the service were noted to be kind and respectful. It was apparent that staff knew each individual well and that they were aware of peoples‚Äô assessed needs and preferences.\r\n\r\nThe home ensures that people have access to appropriate health care professionals. People living at the home confirmed that the home ‚Äúwill always get the doctor when needed‚Äù.\r\nDuring our visit the person in charge requested a GP visit for one individual who was feeling poorly.\r\nThe person in charge told us that they have ‚Äúvery good‚Äù support and input from doctors and specialised health care professionals.\r\n\r\nDuring our visit we observed the senior carer on duty administering the morning and lunch time medicines in a safe and appropriate manner. The staff member took time to explain the medicines to each individual and remained with each person until they had taken their medicines.\r\nMedicines were dispensed to each individual from a trolley which was locked when left unattended. We observed the staff member making an appropriate entry in the medication administration record only after the medicine had been taken by the individual.\r\nWe were informed that only senior care staff who have been appropriately trained are involved in the management and administration of peoples‚Äô medication. A list of these staff along with their signature and initials was made available.\r\n\r\nEach person spoken with during our visit was very complimentary about the provision of food at the home. They told us; ‚Äúthere is plenty to eat and you can always have snacks if you want them‚Äù, ‚Äúthe food is very good and you never go hungry here‚Äù. ‚ÄúThe staff know what I like and what I don‚Äôt like‚Äù.\r\nPeople told us that they were asked about their meal preferences the day before. People confirmed they were offered choices although on the day of our visit, each person was provided with the same meal.\r\n\r\nOn the morning of our visit we asked people if they knew what was for lunch and nobody did. Menus were not displayed for people.\r\nWe observed staff offering assistance to an individual in an appropriate and unhurried manner.\r\nPeople were offered a choice of hot drinks throughout the day and cold drinks were seen to be available in communal areas and individual bedrooms.\r\n\r\nPeople living at the home appeared relaxed and comfortable in the presence of staff and nobody spoken with raised any concerns regarding the way they were treated or of the care they received. People said, ‚Äúthe staff are very kind here‚Äù, ‚ÄúThey are all so kind and caring‚Äù, ‚ÄúI feel very safe well cared for here‚Äù.\r\nDuring our visit we were able to speak with a number of staff working at the home and they were able to demonstrate a good understanding of what constituted abuse. Staff told us that they ‚Äúwould not hesitate‚Äù in reporting abuse where suspected or witnessed however, staff were not aware of how or who to report concerns to outside of the home. Staff were not aware of Somerset‚Äôs policy on safeguarding adults and the policy could not be located during our visit.\r\nWe did not have access to a staff training matrix but all care staff spoken with during our visit confirmed that they had not received any formal training on safeguarding adults from abuse.\r\n\r\nDuring our visit we viewed all communal areas and a selection of bedrooms and we found the standard of cleanliness to be very good with no malodours.\r\nWe were able to see that staff had access to a good supply of protective equipment such as gloves and aprons and that these were being used appropriately as ‚Äòsingle use‚Äô.\r\nPeople told us that they felt ‚Äúwell looked after‚Äù. Staff confirmed that they did not experience any concerns in meeting the needs of people living at the home.\r\nPeople commented on the kindness of the staff. They also told us that, although staff were ‚Äúvery busy‚Äù, they did not feel rushed when receiving assistance from staff.\r\nMost of the people we spoke with told us that since the activity coordinator left in April of this year, there was not much going on in the home. They said; ‚Äúthe activities used to be really good but now all we do is sit around‚Äù. They also said; ‚Äúthere isn‚Äôt anything going on, I just watch television‚Äù, ‚ÄúIt would be really nice if we could have the activities back, there used to be so much and we used to have entertainers come in‚Äù. The home is currently in the process of recruiting a new activity coordinator.\r\n\r\nThe Towans has been suitably adapted and extended to meet the needs of older people. Bedrooms are for single occupancy and we were able to see that people are able to personalise their rooms. We found bedrooms to be very comfortable furnished and some people had chosen to bring items of their own furniture with them.\r\nPeople told us; ‚ÄúI am very happy here and I love my room‚Äù, ‚ÄúI like to sit in my room as I have all my things around me and I have a lovely sea view‚Äù, ‚ÄúIt was very hard leaving my home but I could bring some of my furniture with me and it makes it feel more like home‚Äù.\r\n\r\nMobile and fixed hoists are available to assist people with their mobility needs and people have access to appropriate numbers of assisted bathing and toilet facilities. We were able to see evidence that all equipment had been regularly serviced by outside contractors.\r\nA call bell system is installed throughout the home so that people can call staff for assistance as required. People told us that staff responded promptly to call bells. ‚ÄúI sometimes have to use my call bell at night and the staff come quite quickly‚Äù, ‚ÄúI don‚Äôt need to use my bell much but the staff always come when I need them‚Äù. During our visit we saw that people had easy access to their call bells.\r\n\r\nStaff spoken with during our visit confirmed that they completed a period of induction when they first started working at the home which ensured they have the skills and training needed to enable them to meet the needs of people living at the home. Staff also told us they had at least two ‚Äòshadow shifts‚Äô with more experienced staff, before they worked as part of the shift.\r\nStaff working at the home told us that they received regular one to one supervisions with the manager. They confirmed that this provided them with opportunities to discuss training needs.\r\n\r\nDuring our visit we asked people if they would feel confident in raising concerns if they had any. People told us, ‚ÄúYes, I would always tell someone if I had any concerns or worries‚Äù, ‚ÄúI don‚Äôt have any worries at all‚Äù.\r\nStaff spoken with during our visit knew what to do if a person using the service or a visitor raised concerns about the care they received or the service provision.\r\n\r\nWe examined a range of records during our visit and all were found to be well maintained and up to date. We saw that all records pertaining to people using the service had been securely stored to ensure confidentiality.\r\nAll staff working at the home are required to sign a code of conduct and confidentiality policy.','ML-ROC-4033',NULL);
